const incoming = items[0]?.json ?? {};
const seed = {
  runId: incoming.runId || `${Date.now()}`,
  requestedMarket: incoming.market || process.env.DEFAULT_MARKET || 'AZ-Maricopa',
  leadCollections: incoming.leadCollections || {},
  executionMeta: {
    startedAt: new Date().toISOString(),
    trigger: incoming.trigger || 'automation'
  }
};
return [{ json: seed }];

const [{ json }] = items.length ? items : [{ json: {} }];
const { PROPSTREAM_API_KEY, PROPSTREAM_BASE_URL = 'https://api.propstream.com', PROPSTREAM_SEARCH_LIMIT = '500' } = process.env;
if (!PROPSTREAM_API_KEY) {
  throw new Error('Missing PROPSTREAM_API_KEY environment variable.');
}
const market = json.requestedMarket || process.env.DEFAULT_MARKET || 'AZ-Maricopa';
const response = await this.helpers.httpRequest({
  method: 'GET',
  uri: `${PROPSTREAM_BASE_URL.replace(/\/$/, '')}/leads`,
  qs: {
    filter: 'tired-landlord',
    limit: PROPSTREAM_SEARCH_LIMIT,
    market
  },
  headers: {
    'x-api-key': PROPSTREAM_API_KEY,
    accept: 'application/json'
  },
  json: true
});
const leadsRaw = Array.isArray(response?.leads) ? response.leads : [];
json.executionMeta = json.executionMeta || {};
const normalized = leadsRaw.map((lead) => ({
  source: 'PropStream',
  parcelId: lead.parcelId || lead.apn || null,
  address1: lead.mailingAddress?.line1 || lead.address || '',
  city: lead.mailingAddress?.city || '',
  state: lead.mailingAddress?.state || '',
  postalCode: lead.mailingAddress?.zip || '',
  ownerName: lead.owner?.name || '',
  mailingAddress: lead.mailingAddress || null,
  property: lead.property || null,
  financials: lead.financials || null,
  tags: ['tired-landlord'],
  raw: lead
}));
json.leadCollections = json.leadCollections || {};
json.leadCollections.propstream = normalized;
return [{ json }];

const [{ json }] = items.length ? items : [{ json: {} }];
const { COUNTY_RECORDS_BASE_URL = 'https://api.countyrecords.io', COUNTY_RECORDS_TOKEN } = process.env;
if (!COUNTY_RECORDS_TOKEN) {
  throw new Error('Missing COUNTY_RECORDS_TOKEN environment variable.');
}
const county = process.env.DEFAULT_COUNTY || 'Maricopa';
const state = (json.state || process.env.DEFAULT_STATE || 'AZ').toUpperCase();
const response = await this.helpers.httpRequest({
  method: 'GET',
  uri: `${COUNTY_RECORDS_BASE_URL.replace(/\/$/, '')}/v1/tax-delinquent`,
  qs: {
    state,
    county,
    status: 'open',
    limit: process.env.COUNTY_RECORDS_LIMIT || '500'
  },
  headers: {
    authorization: `Bearer ${COUNTY_RECORDS_TOKEN}`,
    accept: 'application/json'
  },
  json: true
});
const leadsRaw = Array.isArray(response?.records) ? response.records : [];
json.executionMeta = json.executionMeta || {};
const normalized = leadsRaw.map((lead) => ({
  source: 'CountyRecords',
  parcelId: lead.parcel_number || lead.parcelId || null,
  address1: lead.situs_address?.line1 || lead.address || '',
  city: lead.situs_address?.city || '',
  state: lead.situs_address?.state || state,
  postalCode: lead.situs_address?.zip || '',
  ownerName: lead.owner_name || '',
  delinquentAmount: lead.amount_due || 0,
  delinquentYear: lead.tax_year || null,
  tags: ['tax-delinquent'],
  raw: lead
}));
json.leadCollections = json.leadCollections || {};
json.leadCollections.county = normalized;
return [{ json }];

const [{ json }] = items.length ? items : [{ json: {} }];
const { REDFIN_DOM_BASE_URL = 'https://api.redfindata.ai', REDFIN_DOM_TOKEN } = process.env;
if (!REDFIN_DOM_TOKEN) {
  throw new Error('Missing REDFIN_DOM_TOKEN environment variable.');
}
const market = json.requestedMarket || process.env.DEFAULT_MARKET || 'AZ-Maricopa';
const response = await this.helpers.httpRequest({
  method: 'GET',
  uri: `${REDFIN_DOM_BASE_URL.replace(/\/$/, '')}/v1/days-on-market`,
  qs: {
    market,
    maxDom: process.env.REDFIN_MAX_DOM || '120',
    status: 'active'
  },
  headers: {
    authorization: `Bearer ${REDFIN_DOM_TOKEN}`,
    accept: 'application/json'
  },
  json: true
});
const leadsRaw = Array.isArray(response?.properties) ? response.properties : [];
json.executionMeta = json.executionMeta || {};
const normalized = leadsRaw.map((lead) => ({
  source: 'RedfinDOM',
  parcelId: lead.parcelId || null,
  address1: lead.address?.line1 || '',
  city: lead.address?.city || '',
  state: lead.address?.state || '',
  postalCode: lead.address?.postalCode || '',
  dom: lead.metrics?.dom || null,
  price: lead.price || null,
  tags: ['high-dom'],
  raw: lead
}));
json.leadCollections = json.leadCollections || {};
json.leadCollections.redfin = normalized;
return [{ json }];

const [{ json }] = items.length ? items : [{ json: {} }];
const collections = json.leadCollections || {};
const merged = [
  ...(collections.propstream || []),
  ...(collections.county || []),
  ...(collections.redfin || [])
];
json.leads = merged;
json.leadCollections = collections;
json.executionMeta.mergedAt = new Date().toISOString();
json.executionMeta.sourceCounts = {
  propstream: collections.propstream?.length || 0,
  county: collections.county?.length || 0,
  redfin: collections.redfin?.length || 0
};
return [{ json }];

const [{ json }] = items.length ? items : [{ json: {} }];
const leads = Array.isArray(json.leads) ? json.leads : [];
const seen = new Set();
const normalized = [];
for (const lead of leads) {
  const addressKey = [lead.address1, lead.city, lead.state, lead.postalCode].map((part) => (part || '').toString().trim().toUpperCase()).join('|');
  const uniqueKey = lead.parcelId || addressKey;
  if (seen.has(uniqueKey)) {
    continue;
  }
  seen.add(uniqueKey);
  normalized.push({
    ...lead,
    addressKey,
    parcelId: lead.parcelId || null,
    ownerName: lead.ownerName || lead.raw?.owner || null
  });
}
json.leads = normalized;
json.executionMeta.normalizedCount = normalized.length;
return [{ json }];

const [{ json }] = items.length ? items : [{ json: {} }];
const leads = Array.isArray(json.leads) ? json.leads : [];
const batchSize = parseInt(process.env.SKIP_TRACE_BATCH_SIZE || '50', 10);
const batches = [];
for (let i = 0; i < leads.length; i += batchSize) {
  batches.push({
    batchIndex: batches.length,
    leads: leads.slice(i, i + batchSize)
  });
}
return batches.map((batch) => ({ json: { ...batch, runId: json.runId } }));

return items.map(item => {
  const lead = item.json || {};
  const arv = Number(lead.avm?.arv ?? lead.comps?.arv ?? 0);
  const repairEstimate = Number(lead.renovationBudget ?? 0);
  const maoPercent = Number(process.env.MAO_PERCENTAGE ?? '0.7');
  const mao = Math.max(0, arv * maoPercent - repairEstimate);
  return {
    json: {
      ...lead,
      calculations: {
        arv,
        repairEstimate,
        mao
      }
    }
  };
});

return items.map(item => {
  const lead = item.json;
  const condition = Math.max(0, Math.min(25, (lead.propertyConditionScore ?? 0)));
  const motivation = Math.max(0, Math.min(25, (lead.motivationScore ?? (lead.tags?.includes('tax-delinquent') ? 18 : 10))));
  const timeline = Math.max(0, Math.min(25, lead.timelineScore ?? (lead.ownerIntent?.toLowerCase().includes('urgent') ? 20 : 12)));
  const priceFlex = Math.max(0, Math.min(25, lead.priceFlexibilityScore ?? (lead.calculations?.mao && lead.askingPrice ? Math.min(25, (lead.calculations.mao / lead.askingPrice) * 25) : 10)));
  const total = condition + motivation + timeline + priceFlex;
  return {
    json: {
      ...lead,
      score: { condition, motivation, timeline, priceFlex, total }
    }
  };
});
